import { FC, useState, useEffect } from 'react';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';
import './App.css';
import Layout from './components/Layout';
import RouteWrapper from './components/RouteWrapper';
import MyTickets from './components/tickets/MyTickets';
import Login from './components/Login';
import { User, Ticket, TicketStatus } from './types/system';
import { createTicket, getTickets, updateTicketStatus } from './services/api';
import TicketDetail from './components/tickets/TicketDetail';

const App: FC = () => {
  const [tickets, setTickets] = useState<Ticket[]>([]);
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [currentUser, setCurrentUser] = useState<User | null>(null);

  useEffect(() => {
    // Check for existing auth token and user data
    const token = localStorage.getItem('token');
    const savedUser = localStorage.getItem('user');

    if (token && savedUser) {
      setIsAuthenticated(true);
      setCurrentUser(JSON.parse(savedUser));
      // Fetch tickets when authenticated
      fetchTickets();
    }
  }, []);

  const fetchTickets = async () => {
    try {
      const fetchedTickets = await getTickets();
      setTickets(fetchedTickets);
    } catch (error) {
      console.error('Error fetching tickets:', error);
    }
  };

  const handleLoginSuccess = (token: string, user: User) => {
    setIsAuthenticated(true);
    setCurrentUser(user);
    // Fetch tickets after successful login
    fetchTickets();
  };

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('user');
    setIsAuthenticated(false);
    setCurrentUser(null);
    setTickets([]);
  };

  const handleCreateRequest = (navigate: (path: string) => void) => {
    navigate('/tickets/create');
  };

  const handleTicketSubmit = async (ticketData: Omit<Ticket, 'id' | 'status' | 'createdAt' | 'updatedAt'>, navigate: (path: string) => void) => {
    try {
      await createTicket(ticketData);
      // Fetch updated tickets list
      await fetchTickets();
      navigate('/tickets');
      alert('Ticket created successfully!');
    } catch (error) {
      console.error('Error creating ticket:', error);
      alert('Failed to create ticket. Please try again.');
    }
  };

  const handleTicketStatusChange = async (ticketId: string, newStatus: TicketStatus) => {
    try {
      await updateTicketStatus(ticketId, newStatus);
      // Fetch updated tickets list
      await fetchTickets();
    } catch (error) {
      console.error('Error updating ticket status:', error);
      alert('Failed to update ticket status. Please try again.');
    }
  };

  const handleUpdateTicket = async (ticketId: string, newStatus: TicketStatus) => {
    try {
      await updateTicketStatus(ticketId, newStatus);
      // Fetch updated tickets list
      await fetchTickets();
    } catch (error) {
      console.error('Error updating ticket:', error);
      alert('Failed to update ticket. Please try again.');
    }
  };

  if (!isAuthenticated) {
    return <Login onLoginSuccess={handleLoginSuccess} />;
  }

  return (
    <BrowserRouter>
      <Routes>
        <Route 
          path="/" 
          element={
            <Layout 
              currentUser={currentUser!}
              onLogout={handleLogout}
              onCreateRequest={() => {}}
            />
          }
        >
          <Route index element={
            <RouteWrapper 
              component="home"
              tickets={tickets}
              currentUser={currentUser!}
              onCreateRequest={handleCreateRequest}
              onStatusChange={handleTicketStatusChange}
            />
          } />
          <Route 
            path="tickets"
            element={
              <MyTickets
                tickets={tickets}
                currentUser={currentUser!}
              />
            }
          />
          <Route 
            path="tickets/create" 
            element={
              <RouteWrapper 
                component="create"
                currentUser={currentUser!}
                onCreateRequest={handleCreateRequest}
                onSubmit={handleTicketSubmit}
              />
            } 
          />
          <Route path="/" element={<Layout />}>
            <Route path="/" element={<Navigate to="/my-tickets" />} />
            <Route path="/my-tickets" element={<MyTickets tickets={tickets} currentUser={currentUser} onUpdate={handleUpdateTicket} />} />
            <Route path="/tickets/:id" element={<TicketDetail tickets={tickets} currentUser={currentUser} onUpdate={handleUpdateTicket} />} />
          </Route>
          <Route path="*" element={<Navigate to="/" replace />} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
};

export default App;
